(11185, 1082, '_form', '<p>&nbsp;</p>\n<b>Contact Information</b>\n<div id="slim-line"></div>\n\n<p>Your Name (required)<br />\n    [text* your-name] </p>\n\n<p>Company (required)<br />\n    [text* your-company] </p>\n\n<p>Your Email (required)<br />\n    [email* your-email] </p>\n\n<p>Phone<br />\n    [text your-phone] </p>\n\n<p>&nbsp;</p>\n<b>Quantity/Amount</b>\n<div id="slim-line"></div>\n\n<p>Order Quantity<br />\n    [text order-amount] </p>\n\n<p>&nbsp;</p>\n<b>Size</b>\n<div id="slim-line"></div>\n<p>Envelope Height<br />\n    [text env-height] </p>\n<p>Envelope Width<br />\n    [text env-width] </p>\n\n<p>&nbsp;</p>\n<b>Paper</b>\n<div id="slim-line"></div>\n<p>Paper Type<br />\n    [text env-paper] </p>\n\n<p>&nbsp;</p>\n<b>Style</b>\n<div id="slim-line"></div>\n\n<p>&nbsp;</p>\n<p>Envelope Style<br />\n[select env-style include_blank "Open Side" "Open End" "Commercial" "Expansion" "Other"]</p>\n<p>Special Closures<br />\n[select env-close include_blank "Standard" "Special" "Other"]\n\n<p>&nbsp;</p>\n<b>Printing</b>\n<div id="slim-line"></div>\n<p>Print Front (colors)<br />\n    [text env-front-color] </p>\n<p>Print Back (colors)<br />\n    [text env-back-color] </p>\n<p>Full Bleed<br />\n[radio full-bleed label_first default:1 "Yes" "No"]</p>\n\n<p>&nbsp;</p>\n<b>Windows</b>\n<div id="slim-line"></div>\n<p>Number of Windows<br />\n[radio windows label_first default:3 "One" "Two" "None"]</p>\n\n<p>&nbsp;</p>\n<b>Seal</b>\n<div id="slim-line"></div>\n<p>Seal Type<br />\n[select env-seal include_blank "Regular Gum" "Ungummed" "Latex" "Peal & Seal" "Peal & Reseal"]\n\n<p>&nbsp;</p>\n<b>Finishings</b>\n<div id="slim-line"></div>\n<p>Flap Style<br />\n[select env-flap-style include_blank "Clasp" "String & Button" "Other"]\n\n<p>&nbsp;</p>\n<b>Message</b>\n<div id="slim-line"></div>\n<p>Additional Instructions or Message<br />\n    [textarea your-message] </p>\n\n<p>&nbsp;</p>\n<p>Input this code:<br /> [captchac captcha-170]\n[captchar captcha-170 4/4]</p>\n<p