(2, 1, '2013-04-03 01:03:35', '2013-04-03 01:03:35', 'We have complied the following information and forms to help you with your envelope ordering experience. Check this page frequently, as additional information will be posted as they become available.\r\n\r\n&nbsp;\r\n<div id="slim-line"></div>\r\n&nbsp;\r\n<ul>\r\n	<li><a href="http://azenv.youareheremedia.com/wp-content/uploads/2013/04/STANDARD-ENVELOPE-SIZE-CHART.pdf" target="_blank">Standard Envelope Size Chart</a></li>\r\n	<li><a href="http://azenvelope.loc/wp-content/uploads/2013/05/CREDIT_APPLICATION.pdf" target="_blank">Credit Application</a></li>\r\n	<li><a href="http://azenvelope.loc/wp-content/uploads/2015/02/AZ-Resale-Form-5000.pdf">AZ Resale Form 5000</a></li>\r\n	<li><a href="http://azenvelope.loc/wp-content/uploads/2013/05/CONVERTING_GUIDELINES.pdf" target="_blank">Converting Guideline</a></li>\r\n</ul>', 'Helpful Information', '', 'publish', 'open', 'open', '', 'helpful-information', '', '', '2016-09-27 20:30:23', '2016-09-27 20:30:23', '', 0, 'http://azenv.youareheremedia.com/?page_id=2', 0, 'page', '', 0),
(4, 1, '2013-04-03 01:15:43', '2013-04-03 01:15:43', '<div style="padding-bottom: 20px;"><img class="size-medium wp-image-892 alignleft" src="http://shop.aze.dev.laneterralever.com/wp-content/uploads/2015/08/spacer.gif" alt="" width="125" height="175" />\r\n<a href="/product-category/9-10-envelopes/"><img class="size-medium wp-image-892 alignleft" src="http://shop.aze.dev.laneterralever.com/wp-content/uploads/2015/08/Home_Button_1_update112015v2.jpg" alt="Home_Button_2" width="300" height="300" /> </a> <a href="/product-category/stock-size-envelopes/"><img class="size-full wp-image-891 alignleft" src="http://shop.aze.dev.laneterralever.com/wp-content/uploads/2015/08/Home_Button_2_update112015v2.jpg" alt="Home_Button_1" width="300" height="300" /></a></div>', '', '', 'publish', 'closed', 'closed', '', 'home-2', '', '', '2016-09-26 12:20:19', '2016-09-26 12:20:19', '', 0, 'http://azenv.youareheremedia.com/?page_id=4', 0, 'page', '', 0),
