(19, 1, '2013-04-07 04:47:35', '2013-04-07 04:47:35', 'Thank you for viewing our samples page. Arizona Envelope offers several commercial envelope options, including multi-window envelopes. We also offer select printed envelopes using one, two or four colors. Contact us today for a quote on your next custom envelope order!\r\n\r\n&nbsp;\r\n<div id="sample-left">\r\n\r\n<img src="/wp-content/themes/imagethemeresponsive/images/2-Way-Remittance.jpg" alt="" border="0" />\r\n\r\n2-Way Remittance\r\n\r\n</div>\r\n<div id="sample-right">\r\n\r\n<img src="/wp-content/themes/imagethemeresponsive/images/4-color.jpg" alt="" border="0" />\r\n4-color\r\n\r\n</div>\r\n<div style="clear: both;"></div>\r\n<div id="sample-left">\r\n\r\n<img src="/wp-content/themes/imagethemeresponsive/images/Security-Strip.jpg" alt="" border="0" />\r\nSecurity Strip\r\n\r\n</div>\r\n<div id="sample-right">\r\n\r\n<img src="/wp-content/themes/imagethemeresponsive/images/Door-hanger.jpg" alt="" border="0" />\r\nDoor hanger\r\n\r\n</div>\r\n<div style="clear: both;"></div>\r\n<div id="sample-left">\r\n\r\n<img src="/wp-content/themes/imagethemeresponsive/images/Door-Key.jpg" alt="" border="0" />\r\nDoor Key\r\n\r\n</div>\r\n<div id="sample-right">\r\n\r\n<img src="/wp-content/themes/imagethemeresponsive/images/Colored.jpg" alt="" border="0" />\r\nColored\r\n\r\n</div>\r\n<div style="clear: both;"></div>\r\n<div id="sample-left">\r\n\r\n<img src="/wp-content/themes/imagethemeresponsive/images/Expansion.jpg" alt="" border="0" />\r\nExpansion\r\n\r\n</div>\r\n<div id="sample-right">\r\n\r\n<img src="/wp-content/themes/imagethemeresponsive/images/Zipstick.jpg" alt="" border="0" />\r\nZipstick\r\n\r\n</div>\r\n<div style="clear: both;"></div>\r\n<div id="sample-left">\r\n\r\n<img src="/wp-content/themes/imagethemeresponsive/images/InnerOffice-back.jpg" alt="" border="0" />\r\nInnerOffice back\r\n\r\n</div>\r\n<div id="sample-right">\r\n\r\n<img src="/wp-content/themes/imagethemeresponsive/images/InnerOffice