(24, 1, '2013-04-14 18:23:02', '2013-04-14 18:23:02', 'Arizona Envelope Company has been manufacturing and printing envelopes in Arizona for over 30 years. We have recently added new equipment and are planning for more in the future. Our goal is to meet the expedient and exacting demands of our customers.\r\n\r\n&nbsp;\r\n\r\nArizona Envelope has a versatile selection of equipment to run any envelope our customers require. For a view of our complete equipment list <a title="Equipment" href="http://azenvelope.loc/equipment/">click here</a>.\r\n\r\n&nbsp;\r\n\r\nArizona Envelope Company caters to the Trade Industry. The representatives can assist with quotes, status inquiries, technical questions relating to printing and envelope converting and turn times for the jobs or prospective jobs. They work with both the production personnel and estimating personnel to get the information the customer needs. For contact information see our <a title="Contact Us" href="http://azenvelope.loc/contact-us/">Contact Us</a> page.\r\n\r\n&nbsp;\r\n\r\nThis web site is being developed as a tool for our customers. Currently we have an electronic quote form to communicate directly with the estimating departments. This is intended as a back up to our service representatives. It offers a way to initiate a request on weekends, at night or any other time the representative may be unavailable. For our clients that have inventory with us, we are working on a portal so they can check inventory levels as well as release stock for delivery anytime they choose.\r\n\r\n&nbsp;\r\n\r\nIf you have any suggestions, comments or requests on our web site <a title="Contact Us" href="http://azenvelope.loc/contact-us/">please contact us at 800-540-6883.</a>', 'About Us', '', 'publish', 'closed', 'closed', '', 'sample', '', '', '2016-09-30 01:27:25', '2016-09-30 01:27:25', '', 0, 'http://azenv.youareheremedia.com/?page_id=24', 0, 'page', '', 0),
