(38, 1, '2015-01-20 02:28:30', '2015-01-20 02:28:30', 'Are you sending us preprinted stock that Arizona Envelope will die cut and convert into envelopes? You must use one of our Layouts when setting up your artwork.Â  Please see the following list of the most popular layouts.\n\n&nbsp;\n<div id="slim-line"></div>\n&nbsp;\n<ul>\n	<li><strong><a href="/wp-content/uploads/diecuts/Die_Layout_Instructions.pdf" target="_blank">Die Layout Instructions</a></strong></li>\n	<li><strong><a href="/wp-content/uploads/diecuts/Hobbs_Layout_Instructions.pdf" target="_blank">Hobbs Layout Instructions</a></strong></li>\n	<li><a href="http://azenvelope.loc/wp-content/uploads/2016/02/9-Remittance-6up-on-23x35-Outside-Bleeds.pdf">#9 Remittance 6up on 23x35 Outside Bleeds</a></li>\n	<li><a href="/wp-content/uploads/diecuts/10_1_Up_on_11_x_17_Outside_Bleed.pdf" target="_blank">#10 1 Up on 11 x 17 Outside Bleed</a></li>\n	<li><a href="/wp-content/uploads/diecuts/10_2_Up_on_17_1-2_x_23_OutsideBleed.pdf" target="_blank">#10 2 Up on 17 1-2 x 23 OutsideBleed</a></li>\n	<li><a href="/wp-content/uploads/diecuts/10_4_Up_on_19_x_25_Outside_Bleed.pdf" target="_blank">#10 4 Up on 19 x 25 Outside Bleed</a></li>\n	<li><a href="http://azenvelope.loc/wp-content/uploads/2015/01/10_8_up_on_25_x_38_BLEED.pdf">#10_8_up_on_25_x_38_BLEED</a></li>\n	<li><a href="/wp-content/uploads/diecuts/10_Open_Side_4_Up_on_20_x_28_Outside_Bleeds.pdf" target="_blank">#10 Open Side 4 Up on 20 x 28 Outside Bleeds</a></li>\n	<li><a href="http://azenvelope.loc/wp-content/uploads/2016/02/10-Open-Side-8-up-on-28x40-Outside-Bleeds.pdf">#10 Open Side 8 up on 28x40 Outside Bleeds</a></li>\n	<li><a href="http://azenvelope.loc/wp-content/uploads/2013/12/11-1up-12.5-x-19-Outside-Bleeds.pdf">#11 1 Up on 12.5 x 19 Outside Bleeds</a></li>\n	<li><a href="http://azenvelope.loc/wp-content/uploads/2013/04/6-x-9-Open-End-2-Up-on-19-x-25-Oustide-Bleed.pdf">6 x 9 Open End 2 Up on 19 x 25 Oustide Bleed</a></li>\n	<li><a href="/wp-content/uploads/diecuts/6_x_9_Open_Side_1_Up_on_11-2_x_17_Outside_Bleed.pdf" target="_blank">6 x 9 Open Side 1 Up on 11-2 x 17 Outside Bleed</a></li>\n	<li><a href="/wp-content/uploads/diecuts/9_x_12_Open_End_1_Up_on_17_1-2_x_23_Outside_Bleed.pdf" target="_blank">9 x 12 Open End 1 Up on 17 1-2 x 23 Outside Bleed</a></li>\n	<li><a href="/wp-content/uploads/diecuts/9_x_12_Open_End_2_Up_on_23_x_35_Outside_Bleed.pdf" target="_blank">9 x 12 Open End 2 Up on 23 x 35 Outside Bleed</a></li>\n	<li><a href="/wp-content/uploads/diecuts/9_x_12_Open_Side_1_Up_on_17_1-2_x_23_Outside_Bleed.pdf" target="_blank">9 x 12 Open Side 1 Up on 17 1-2 x 23 Outside Bleed</a></li>\n	<li><a href="/wp-content/uploads/diecuts/9_x_12_Open_Side_2_Up_on_23_x_35_Outside_Bleed.pdf" target="_blank">9 x 12 Open Side 2 Up on 23 x 35 Outside Bleed</a></li>\n	<li><a href="http://azenvelope.loc/wp-content/uploads/2013/12/10-x-13-Open-End-1-up-17_5-x-23-Outside-Bleeds.pdf">10 x 13 Open End 1 up 17_5 x 23 Outside Bleeds</a></li>\n	<li><a href="http://azenvelope.loc/wp-content/uploads/2013/12/10-x-13-Open-End-2-up-on-23-x-35-Outside-Bleeds.pdf">10 x 13 Open End 2 up on 23 x 35 Outside Bleeds</a></li>\n	<li><a href="http://azenvelope.loc/wp-content/uploads/2013/12/10-x-13-Open-Side-1-Up-on-17_5-x-23-Outside-Bleeds.pdf">10 x 13 Open Side 1 Up on 17_5 x 23 Outside Bleeds</a></li>\n	<li><a href="http://azenvelope.loc/wp-content/uploads/2013/12/10-x-13-Open-Side-2-Up-on-23-x-35-Outside-Bleeds.pdf">10 x 13 Open Side 2 Up on 23 x 35 Outside Bleeds</a></li>\n	<li><a href="http://azenvelope.loc/wp-content/uploads/2016/02/A-6-2up-on-12-x-18-Outside-Bleeds.pdf">A-6 2up on 12 x 18 Outside Bleeds</a></li>\n	<li><a href="http://azenvelope.loc/wp-content/uploads/2013/12/A-7-4-Up-on-19x25-Outside-Bleeds.pdf">A-7 4 Up on 19x25 Outside Bleeds</a></li>\n	<li><a href="http://azenvelope.loc/wp-content/uploads/2013/12/A-7-4-Up-on-19x25-Outside-Bleeds-Machine-Insertable.pdf">A-7 4 Up on 19x25 Outside Bleeds Machine Insertable</a></li>\n</ul>\n&nbsp;\n<div id="slim-line"></div>\n&nbsp;\n\nIf you do not see the layout you need, please contact us and we will get it for you.Â  Here is the information we will need to produce your layout:\n1. What sheet size you are printing on?Â  2. How many up you will print?Â  3. Are there any outside or inside bleeds?', 'Layouts & Die Lines', '', 'publish', 'open', 'closed', '', 'die-lines', '', '', '2015-01-20 02:28:30', '2015-01-20 02:28:30', '', 0, 'http://azenv.youareheremedia.com/?page_id=38', 0, 'page', '', 0),
