(65, 1, '2013-04-15 02:53:22', '2013-04-15 02:53:22', '<strong>Rotary Automatic (RA)</strong> - High speed/capacity folding machine for commercial and small open side envelopes.Â  Has multiple window capabilities. Prints 2/1 flexo in line.\n\n&nbsp;\n\n<strong>Web feed RA</strong> - High speed/capacity folding machine for commercial and small open side envelopes.Â  Prints 2/1 flexo in line.Â  Can apply peel &amp; seal in line.Â  Has multiple window capabilities. Web feed gives the option of a lower cost alternative to die cut blanks.\n\n&nbsp;\n\n<strong>Wide Range</strong> - Small run folding machine for commercial and small open side envelopes. Has multiple window capabilities. Versatile for quick set ups on smaller runs.\n\n&nbsp;\n\n<strong>MO</strong> - Folding machine for large booklet open side and catalog open end envelopes. Prints 2/0 flexo in line. Can apply peel &amp; seal in line. Has multiple window capabilities.\n\n&nbsp;\n\n<strong>SO</strong> - Folding machine for very small open end and open side envelopes. Can apply latex seal gum.\n\n&nbsp;\n\n<strong>Latex</strong> - Applies latex seal to premanufactured envelopes for self sealing. Flap is extended.\n\n&nbsp;\n\n<strong>Clasp</strong> - Applies clasp to premanufactured envelopes for a resealable envelope. Flap is extended.\n\n&nbsp;\n\n<strong>Jet press</strong> - Lithographic quality printing on premanufactured envelopes. Up to 4 colors with perfecting capability (both face and back printing.)\n\n&nbsp;\n\n<strong>iJet pressÂ  -Â Â  </strong>Quality CMYK digital iJet printing on premanufactured envelopes and flat sheets.\n\n&nbsp;\n\n<strong>GTO/RYOBI press</strong> - Lithographic quality printing up to 4 colors for flat sheets.\n\n&nbsp;\n\n<strong>Diddie Web press - </strong> Lithographic quality printing up to 4 colors with perforating and numbering capabilities.\n\n&nbsp;\n\n&nbsp;', 'Equipment', '', 'publish', 'closed', 'closed', '', 'equipment', '', '', '2013-04-15 02:53:22', '2013-04-15 02:53:22', '', 0, 'http://azenv.youareheremedia.com/?page_id=65', 0, 'page', '', 0),
