(1108, 3, '2013-05-22 14:42:40', '2013-05-22 14:42:40', 'Arizona Envelope has combined with Action Envelope.Â  This brings years of press experience and technical know-how to our manufacturing operations.Â  The customer service, quality and capacity that our customers have been accustomed to will continue and be enhanced by this merger.Â  Our dedication to helping you grow your business has never been stronger.\n\n&nbsp;\n\nWith our full range of envelope manufacturing, we can service all envelope needs better than anyone in the Phoenix area.Â  We encourage all clients to take advantage of the only full service envelope manufacturer in Arizona.Â  This keeps jobs here and guarantees the service, quality and turn times that only Arizona manufacturing can provide.', 'Arizona Envelope has combined with Action Envelope', '', 'publish', 'closed', 'open', '', 'arizona-envelope-has-combined-with-action-envelope', '', '', '2013-05-22 14:42:40', '2013-05-22 14:42:40', '', 0, 'http://azenv.youareheremedia.com/?p=124', 0, 'post', '', 0),
(1109, 3, '2013-09-16 23:15:14', '2013-09-16 23:15:14', '<h2><strong>Permanent Closure to Reduce IP\'s North American Uncoated Freesheet Production Capacity</strong></h2>\nMEMPHIS, Tenn., Sept. 11, 2013 /PRNewswire/ -- International Paper (NYSE: IP) today announced plans to permanently close its Courtland, Ala. Mill, a facility that is part of the company\'s Printing and Communications Papers Business.\n\n<!--more-->\n\nThe mill will shut down in stages with a full closure expected to be complete by the end of the first quarter of 2014.Â  This mill closure will reduce IP\'s North American uncoated and coated freesheet paper production capacity by 950,000 tons, of which 765,000 is uncoated freesheet.', 'International Paper Announces Closure of its Courtland, Ala. Paper Mill', '', 'publish', 'closed', 'open', '', 'international-paper-announces-closure-of-its-courtland-ala-paper-mill', '', '', '2013-09-16 23:15:14', '2013-09-16 23:15:14', '', 0, 'http://azenvelope.com/?p=179', 0, 'post', '', 0),
